import React, {Component} from 'react';
import {Menu} from "antd";

const {SubMenu}=Menu;

class WikiNav extends Component {
    render() {
        return (
            <Menu style={{width:'256px'}}>
                <SubMenu title='1 开发前须知'>
                    <Menu.ItemGroup title='1.1 Wiki声明'>
                        <Menu.Item>1.1.1 Wiki法律条款</Menu.Item>
                        <Menu.Item>1.1.2 Wiki适用范围</Menu.Item>
                    </Menu.ItemGroup>
                </SubMenu>
                <SubMenu title='2 开发环境准备'>
                    <Menu.ItemGroup title='2.1 开发工具'>
                        <Menu.Item>2.1.1 Wiki法律条款</Menu.Item>
                        <Menu.Item>1.1.2 Wiki适用范围</Menu.Item>
                    </Menu.ItemGroup>
                </SubMenu>
                <SubMenu title='3 接口文档'>
                    <Menu.ItemGroup title='3.1 token鉴权'>
                        <Menu.Item>3.1.1 Wiki法律条款</Menu.Item>
                        <Menu.Item>3.1.2 Wiki适用范围</Menu.Item>
                    </Menu.ItemGroup>
                    <Menu.ItemGroup title='3.2 单点登录'>
                        <Menu.Item>3.2.1 Wiki法律条款</Menu.Item>
                        <Menu.Item>3.2.2 Wiki适用范围</Menu.Item>
                    </Menu.ItemGroup>
                </SubMenu>
            </Menu>
        );
    }
}

export default WikiNav;
